    [],nt"num_tags": 3,nt"name": "back-bay-national-wildlife-refuge-refuge-narrative-report-january-april-1958",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Back Bay NWR
    outlines Refuge accomplishments from January through April of 1958. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, furbearers, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, vegetation control,
    and prescribed burning. Resource management is outlined; topics include commercial
    fishing. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, and violations. Items of interest,
    N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
